import React, { useEffect, useState } from "react";
import DropDown from '../DropDown'
import AreaChartContainer from './AreaIKTBeschäftigung'
import '../../styles/charts.css'


export default function Nutzungsgründe() {
  
    const [mann, setMann] = useState([]);
    const [frau, setFrau] = useState([]);
    const [highlight, setHighlight] = useState();

    useEffect(() => {
        fetch("https://webhooks.mongodb-stitch.com/api/client/v2.0/app/dataviztest-bbcvc/service/viz/incoming_webhook/webhook5")
          .then(response => response.ok && response.json())
          .then(dataMann => {
            setMann(
              dataMann.sort((a, b) => a.geo.localeCompare(b.geo))
            );
          })
          .catch(console.error);
      }, []);

      useEffect(() => {
        fetch("https://webhooks.mongodb-stitch.com/api/client/v2.0/app/dataviztest-bbcvc/service/viz/incoming_webhook/webhook6")
          .then(response => response.ok && response.json())
          .then(dataFrau => {
            setFrau(
              dataFrau.sort((a, b) => a.geo.localeCompare(b.geo))
            );
          })
          .catch(console.error);
      }, []);


    return (
            <div className="chart4">
                <div className="IKTWrapping">
                        <div className="IKTHeadLine">
                            <div className="IKTgHead">
                                <h1>IKT Beschäftigung</h1>
                            </div>
                            <div className="IKTText">
                                <p>
                                At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren,
                                no sea takimata sanctus est Lorem ipsum dolor sit amet. At vero eos et accusam et justo duo dolores et ea rebum.   
                                </p>
                            </div>
                        </div>
                        <select>
              <option>Wähle ein Land</option>
              <option></option>
             </select>
                        </div>
                        <div className="ChartIKTWrap">
                            <div className="ChartIKT">
                            <AreaChartContainer dataMann={mann} dataFrau={frau}></AreaChartContainer>
                            </div>
                        <div className="ChartIKTCards">

                        </div>
                        </div>
            </div>

    );
}
